import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './RestaurantOwnerDashboard.css';
import { useNavigate } from 'react-router-dom';

const RestaurantOwnerDashboard = () => {
  const [profileData, setProfileData] = useState(null);
  const [restaurants, setRestaurants] = useState([]);
  const [restaurantName, setRestaurantName] = useState('');
  const [restaurantAddress, setRestaurantAddress] = useState('');
  const [contactNumber, setContactNumber] = useState('');
  const [description, setDescription] = useState('');
  const [restaurantImage, setRestaurantImage] = useState(null);
  const [isOpen, setIsOpen] = useState(false);
  const [showProfilePanel, setShowProfilePanel] = useState(false);
  const [showAddRestaurantPanel, setShowAddRestaurantPanel] = useState(false);
  const [showRestaurantsPanel, setShowRestaurantsPanel] = useState(false);
  const [successMessage, setSuccessMessage] = useState('');
  
  const navigate = useNavigate();
  
  const userId = localStorage.getItem('userId'); 

  useEffect(() => {
    if (showProfilePanel) {
      axios.get(`http://localhost:100/users/profile/${userId}`)
        .then(response => {
          setProfileData(response.data);
        })
        .catch(error => {
          console.error("There was an error fetching the profile!", error);
        });
    }
  }, [showProfilePanel, userId]);

  const handleMyProfileClick = () => {
    setShowProfilePanel(!showProfilePanel);
    setShowAddRestaurantPanel(false);
    setShowRestaurantsPanel(false);
  };

  const handleAddRestaurantClick = () => {
    setShowAddRestaurantPanel(!showAddRestaurantPanel);
    setShowProfilePanel(false);
    setShowRestaurantsPanel(false);
  };

  const handleViewRestaurantsClick = () => {
    setShowRestaurantsPanel(!showRestaurantsPanel);
    setShowProfilePanel(false);
    setShowAddRestaurantPanel(false);

    if (!showRestaurantsPanel) {
      // Fetch the user's restaurants
      axios.get(`http://localhost:300/restaurant/user/${userId}`)
        .then(response => {
          setRestaurants(response.data);
        })
        .catch(error => {
          console.error("There was an error fetching the restaurants!", error);
        });
    }
  };

  const handleNavigation = (path) => {
    navigate(path, { state: { userId: userId } });
  };

  const handleFileChange = (event) => {
    setRestaurantImage(event.target.files[0]);
  };

  const handleSubmit = (event) => {
    event.preventDefault();

    const formData = new FormData();
    formData.append('userId', userId);
    formData.append('restaurantName', restaurantName);
    formData.append('restaurantAddress', restaurantAddress);
    formData.append('contactNumber', contactNumber);
    formData.append('description', description);
    formData.append('isOpen', isOpen);
    formData.append('restaurantImage', restaurantImage);

    axios.post('http://localhost:300/restaurant/addRestaurant', formData)
      .then(response => {
        setSuccessMessage('Restaurant added successfully!');
        setRestaurants([...restaurants, response.data]); // Add new restaurant to the list
        setShowAddRestaurantPanel(false); // Hide the form after successful submission
      })
      .catch(error => {
        console.error('There was an error adding the restaurant!', error);
      });
  };

  return (
    <div className="owner-dashboard-container">
      <nav className="navbar">
        <div className="navbar-left">Restaurant Owner Dashboard</div>
        <div className="navbar-right">
          <button onClick={() => handleNavigation('/')}>Home</button>
          <button onClick={() => handleNavigation('/logout')}>Logout</button>
        </div>
      </nav>

      <aside className="sidebar">
        <h3>Actions</h3>
        <button onClick={handleMyProfileClick}>My Profile</button>
        <button onClick={handleAddRestaurantClick}>Add Restaurant</button>
        <button onClick={handleViewRestaurantsClick}>My Restaurants</button>
      </aside>

      <div className="content">
        {successMessage && <div className="success-message">{successMessage}</div>}

        {showProfilePanel && profileData && (
          <div className={`profile-panel ${showProfilePanel ? 'visible' : ''}`}>
            <div className="profile-details">
              <h2>Profile Information</h2>
              <p><strong>Name:</strong> {`${profileData.firstName} ${profileData.lastName}`}</p>
              <p><strong>Email:</strong> {profileData.email}</p>
              <p><strong>Phone Number:</strong> {profileData.phoneNo}</p>
              <p><strong>Role:</strong> {profileData.role}</p>
            </div>
          </div>
        )}

        {showAddRestaurantPanel && (
          <div className="add-restaurant-container">
            <h2>Add Restaurant</h2>
            <form onSubmit={handleSubmit} encType="multipart/form-data">
              <div className="form-group">
                <label htmlFor="restaurantName">Restaurant Name:</label>
                <input
                  type="text"
                  id="restaurantName"
                  value={restaurantName}
                  onChange={(e) => setRestaurantName(e.target.value)}
                  required
                />
              </div>

              <div className="form-group">
                <label htmlFor="restaurantAddress">Restaurant Address:</label>
                <input
                  type="text"
                  id="restaurantAddress"
                  value={restaurantAddress}
                  onChange={(e) => setRestaurantAddress(e.target.value)}
                  required
                />
              </div>

              <div className="form-group">
                <label htmlFor="contactNumber">Contact Number:</label>
                <input
                  type="text"
                  id="contactNumber"
                  value={contactNumber}
                  onChange={(e) => setContactNumber(e.target.value)}
                  pattern="^[9876]\d{9}$"
                  title="Phone number must start with 9, 8, 7, or 6 and contain 10 digits"
                  required
                />
              </div>

              <div className="form-group">
                <label htmlFor="description">Description:</label>
                <textarea
                  id="description"
                  value={description}
                  onChange={(e) => setDescription(e.target.value)}
                  required
                ></textarea>
              </div>

              <div className="form-group">
                <label htmlFor="isOpen">Is Open:</label>
                <input
                  type="checkbox"
                  id="isOpen"
                  checked={isOpen}
                  onChange={(e) => setIsOpen(e.target.checked)}
                />
              </div>

              <div className="form-group">
                <label htmlFor="restaurantImage">Restaurant Image:</label>
                <input
                  type="file"
                  id="restaurantImage"
                  accept="image/*"
                  onChange={handleFileChange}
                  required
                />
              </div>

              <button type="submit">Add Restaurant</button>
            </form>
          </div>
        )}

        {showRestaurantsPanel && (
          <div className="restaurants-list">
            <h2>My Restaurants</h2>
            {restaurants.length > 0 ? (
              <ul>
                {restaurants.map(restaurant => (
                  <li key={restaurant.restaurantId}>
                    <h3>{restaurant.restaurantName}</h3>
                    <p>{restaurant.restaurantAddress}</p>
                    <p>{restaurant.contactNumber}</p>
                    <p>{restaurant.description}</p>
                    <p>{restaurant.isOpen ? 'Open' : 'Closed'}</p>
                  </li>
                ))}
              </ul>
            ) : (
              <p>No restaurants found.</p>
            )}
          </div>
        )}
      </div>
    </div>
  );
};

export default RestaurantOwnerDashboard;
